import React from 'react';
import styled from 'styled-components';





const Container = styled.div`
    width: 1900px;
    height: 680px;
    padding: 55px 0;
    margin: 0 0 80px;
    position: relative;
    text-align: center;
    background: #f0f3ff;

`

const Box = styled.div`
    width: 1140px;
    height: 680px;
    text-align: left;
    padding: 0 10px;
    margin: 0 315px 0;
    position:absolute;
`


class Illustration extends React.Component{
    render(){
        return(
            <Container >
                <Box >


                </Box>
            </Container>
        );
    }

}

export default Illustration;
